import React from "react";
import overlayIcon1 from "../../assets/overlay-icons/overlay1.png";
import overlayIcon2 from "../../assets/overlay-icons/overlay2.png";
import overlayIcon3 from "../../assets/overlay-icons/overlay3.png";
import overlayIcon4 from "../../assets/overlay-icons/overlay4.png";
import overlayIcon5 from "../../assets/overlay-icons/overlay5.png";
import overlayIcon6 from "../../assets/overlay-icons/overlay6.png";
import overlayIcon7 from "../../assets/overlay-icons/overlay7.png";
import overlayIcon8 from "../../assets/overlay-icons/overlay8.png";
import overlayIcon11 from "../../assets/overlay-icons/overlay11.png";

import "./OverlayBg.css";

const OverlayBg1 = ({ style }) => {
  return (
    <div className="overlay-icon" style={style}>
      <img src={overlayIcon1} alt="" />
    </div>
  );
};
const OverlayBg2 = ({ style }) => {
  return (
    <div className="overlay-icon" style={style}>
      <img src={overlayIcon2} alt="" />
    </div>
  );
};
const OverlayBg3 = ({ style }) => {
  return (
    <div className="overlay-icon" style={style}>
      <img src={overlayIcon3} alt="" />
    </div>
  );
};
const OverlayBg4 = ({ style }) => {
  return (
    <div className="overlay-icon" style={style}>
      <img src={overlayIcon4} alt="" />
    </div>
  );
};
const OverlayBg5 = ({ style }) => {
  return (
    <div className="overlay-icon" style={style}>
      <img src={overlayIcon11} alt="" />
    </div>
  );
};
const OverlayBg6 = ({ style }) => {
  return (
    <div className="overlay-icon" style={style}>
      <img src={overlayIcon5} alt="" />
    </div>
  );
};
const OverlayBg7 = ({ style }) => {
  return (
    <div className="overlay-icon" style={style}>
      <img src={overlayIcon6} alt="" />
    </div>
  );
};
const OverlayBg8 = ({ style }) => {
  return (
    <div className="overlay-icon" style={style}>
      <img src={overlayIcon7} alt="" />
    </div>
  );
};

export {
  OverlayBg1,
  OverlayBg2,
  OverlayBg3,
  OverlayBg4,
  OverlayBg5,
  OverlayBg6,
  OverlayBg7,
  OverlayBg8,
};
